SELECT
    indexname,
    indexdef
FROM pg_indexes
WHERE tablename = 'tenants2';



CREATE INDEX idx_applications_tenant_namespace ON applications(tenant_id, namespace_id);




CREATE OR REPLACE VIEW domain_applications_view AS
SELECT
    d.domain_name,
    t.tenant_name,
    t.tenant_id,
    e.environment_name,
    ns.namespace,
    a.application_name,
    a.application_id
FROM domains d
JOIN tenants2 t ON d.domain_id = t.domain_id
JOIN applications a ON a.tenant_id = t.tenant_id
JOIN namespaces ns ON ns.namespace_id = a.namespace_id
JOIN environments2 e ON e.environment_id = ns.environment_id AND e.tenant_id = t.tenant_id;



SELECT COUNT(*) FROM tenants WHERE domain_id IS NULL;
SELECT COUNT(*) FROM environments WHERE tenant_id IS NULL;
SELECT COUNT(*) FROM namespaces WHERE environment_id IS NULL;
SELECT COUNT(*) FROM applications WHERE namespace_id IS NULL OR tenant_id IS NULL;





CREATE OR REPLACE VIEW domain_applications_view AS
SELECT 
    d.domain_id,
    d.domain_name,
    t.tenant_id,
    t.tenant_name,
    e.environment_id,
    e.environment_name,
    ns.namespace_id,
    ns."namespace",
    a.application_id,
    a.application_name
FROM domains d
JOIN tenants2 t ON t.domain_id = d.domain_id
LEFT JOIN environments2 e ON e.tenant_id = t.tenant_id
LEFT JOIN namespaces ns ON ns.environment_id = e.environment_id
LEFT JOIN applications a ON a.namespace_id = ns.namespace_id AND a.tenant_id = t.tenant_id;








