ALTER TABLE analytics.deployment_descriptor  
ADD COLUMN IF NOT EXISTS id INT NOT NULL,
ADD CONSTRAINT fk_dd_descriptor_id FOREIGN KEY (id) REFERENCES descriptors(id) ON DELETE CASCADE;
ALTER TABLE analytics.solution_descriptor  
ADD COLUMN IF NOT EXISTS id INT NOT NULL,
ADD CONSTRAINT fk_sd_descriptor_id FOREIGN KEY (id) REFERENCES descriptors(id) ON DELETE CASCADE;


CREATE TABLE analytics.deployment_descriptor (
    id SERIAL PRIMARY KEY,
	application_name CHARACTER VARYING (100),
    descriptor JSONB,             -- Store the JSON descriptor content here
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP
);


CREATE TABLE analytics.solution_descriptor (
    id SERIAL PRIMARY KEY,
    descriptor JSONB,             -- Store the JSON descriptor content here
	created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP
    
);


CREATE TABLE deployment_descriptors (
    id SERIAL PRIMARY KEY,
    app_name VARCHAR(255),        -- Optionally store the application name or any other useful metadata
    descriptor JSONB,             -- Store the JSON descriptor content here
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP
);



CREATE TABLE external_delivery (
    execution_id SERIAL PRIMARY KEY, 
    descriptor_id SERIAL,
    app_name VARCHAR(255),
    artifact_descriptor_version VARCHAR(255),              
    transfer_date TIMESTAMP DEFAULT CURRENT_TIMESTAMP
	FOREIGN KEY (descriptor_id) REFERENCES desciptors(id) ON DELETE CASCADE
);
