CREATE TABLE pr_metadata (
    pr_id SERIAL PRIMARY KEY,                   -- Unique identifier for the PR
    author VARCHAR(255) NOT NULL,               -- The individual who created the PR
    participants TEXT[],                         -- List of individuals who took action on the PR (excluding author)
    stage VARCHAR(100) NOT NULL,                -- The stage the PR has been through (e.g., Open, Review, Merged, Deployed)
    repository VARCHAR(255) NOT NULL,           -- The repository where the PR was created
    ticket_issue_type VARCHAR(100) NULL,        -- Ticket type (e.g., Story, Bug, Task)
    created_at TIMESTAMP DEFAULT NOW(),         -- Timestamp of PR creation
    merged_at TIMESTAMP NULL,                   -- Timestamp when PR was merged
    deployed_at TIMESTAMP NULL,                 -- Timestamp when PR was deployed
    updated_at TIMESTAMP DEFAULT NOW()          -- Last modified time of PR
);



	
