SELECT  
    DATE(created_at) AS deployment_date,
    repository,
    AVG(EXTRACT(EPOCH FROM (deployed_at - created_at)) / 60) AS avg_lead_time_minutes
FROM pr_metadata
WHERE deployed_at IS NOT NULL
GROUP BY deployment_date, repository
ORDER BY deployment_date;
	

